import siblingBackground from "../assets/Lytra.jpeg";
import picnicBackground from "../assets/picnic.jpeg";
import seaBackground from "../assets/sea.jpeg";
import sunsetBackground from "../assets/sunset.jpeg";
const Images = {
  SIBLING_BG: siblingBackground,
  PICNIC_BG: picnicBackground,
  SEA_BG: seaBackground,
  SUNSET_BG: sunsetBackground,
}
export default Images
